query:
      query searchModel($storeId: String,  $startIndex: Int, $pageSize: Int, $orderBy: ProductSort, $filter: ProductFilter,  $keyword: String, $navParam: String, $storefilter: StoreFilter = ALL, $itemIds: [String], $channel: Channel = DESKTOP, $additionalSearchParams: AdditionalParams, $loyaltyMembershipInput: LoyaltyMembershipInput) {
  searchModel(keyword: $keyword, navParam: $navParam, storefilter: $storefilter, storeId: $storeId, itemIds: $itemIds, channel: $channel, additionalSearchParams: $additionalSearchParams, loyaltyMembershipInput: $loyaltyMembershipInput) {
    metadata {
      categoryID
      analytics {
        semanticTokens
        dynamicLCA
      }
      canonicalUrl
      searchRedirect
      clearAllRefinementsURL
      contentType
      isStoreDisplay
      productCount {
        inStore
      }
      stores {
        storeId
        storeName
        address {
          postalCode
        }
      }
    }
    id
    searchReport {
      totalProducts
      didYouMean
      correctedKeyword
      keyword
      pageSize
      searchUrl
      sortBy
      sortOrder
      startIndex
      __typename
    }
    products(startIndex: $startIndex, pageSize: $pageSize, orderBy: $orderBy, filter: $filter) {
      identifiers {
        storeSkuNumber
        canonicalUrl
        brandName
        itemId
        productLabel
        modelNumber
        productType
        parentId
        isSuperSku
      }
      itemId
      dataSources
      pricing(storeId: $storeId) {
        value
        alternatePriceDisplay
        alternate {
          bulk {
            pricePerUnit
            thresholdQuantity
            value
          }
          unit {
            caseUnitOfMeasure
            unitsOriginalPrice
            unitsPerCase
            value
          }
        }
        original
        mapAboveOriginalPrice
        message
        preferredPriceFlag
        unitOfMeasure
      }
      reviews {
        ratingsReviews {
          averageRating
          totalReviews
        }
      }
      availabilityType {
        discontinued
      }

    }

  }
}
